"use strict";(self.webpackChunk=self.webpackChunk||[]).push([[1716],{1716:e=>{e.exports=JSON.parse('{"en":{"main_title":"Edgar Degas","name":"Edgar Degas","born_year":"1834","died_year":"1917","description":"He is considered one of the founders of impressionism, although he rejected the term and preferred to be called a realist. An excellent draftsman, he is particularly identified with the subject of dance, and more than half of his works depict dancers. They demonstrate his skill in depicting movement, as do his subjects of the racecourse and nude women. He was also an excellent sculptor and created the famous sculpture \'Little Dancer\'"},"ua":{"main_title":"Едґар Деґа","name":"Едґар Деґа","born_year":"1834","died_year":"1917","description":"Його вважають одним із засновників імпресіонізму, хоча він відкидав цей термін і вважав за краще називатися реалістом. Чудовий рисувальник, він особливо пов\'язаний з темою танцю, і більше половини його робіт зображують танцюристів. Вони демонструють його майстерність у зображенні руху, як і його предмети іподрому та оголених жінок. Він також був чудовим скульптором і створив знамениту скульптуру «Маленька танцівниця»."},"es":{"main_title":"Edgar Degas","name":"Edgar Degas","born_year":"1834","died_year":"1917","description":"Se le considera uno de los fundadores del impresionismo, aunque rechazó el término y prefirió llamarse realista. Excelente dibujante, se identifica especialmente con el tema de la danza, y más de la mitad de sus obras representan bailarines. Demuestran su habilidad para representar el movimiento, al igual que sus temas del hipódromo y las mujeres desnudas. También fue un excelente escultor y creó la famosa escultura \'Little Dancer\'"}}')}}]);